import React, { Component } from "react";
import Exercises from "./Exercises";
import Selection from "./Selection";

export default class HomePage extends Component {
  constructor(props) {
    super(props);
    this.state = props;
  }

  

  render() {
    const { workouts, selectedWorkouts } = this.state;

    return (
      <div>
        <div className="container-fluid">
          <div className="row justify-content-center">
            <Exercises workouts={workouts} workoutSelect={this.workoutSelect} />
            <Selection
              selectedWorkouts={selectedWorkouts}
              workoutDeselect={this.workoutDeselect}
              workoutCompleted={this.workoutCompleted}
            />            
          </div>
          <div className="row justify-content-center">
                <button className="btn btn-success bottom-margin">Start!</button>
          </div>
        </div>
      </div>
    );
  }
}
